-- Kütüphane yükleme
local Library = loadstring(game:HttpGet("https://sirius.menu/rayfield"))()

-- Ana pencere
local Window = Library:CreateWindow({
    Name = "Big Hub",
    Folder = "HubFolder",
    Save = true,
    ConfigurationSaving = {
        Enabled = true,
        FolderName = "BigHubConfigs",
        FileName = "Settings"
    },
    Discord = {
        Enabled = true,
        Invite = "discordInviteHere",
        RememberJoins = true
    },
    KeySystem = false,
    KeySettings = {
        Title = "Untitled Hub",
        Subtitle = "Key System",
        Note = "No method of obtaining the key is provided",
        FileName = "Key",
        SaveKey = true,
        GrabKeyFromSite = false
    }
})

