-- CHARACTER TAB
---------------------------------------------------------------------
local Section1 = Tab1:CreateSection("Player")

Section1:CreateSlider("WalkSpeed", {Min = 16, Max = 200, Default = 16, Increment = 1, Suffix = " speed"}, function(val)
    game.Players.LocalPlayer.Character.Humanoid.WalkSpeed = val
end)

Section1:CreateSlider("JumpPower", {Min = 50, Max = 300, Default = 50, Increment = 1, Suffix = " power"}, function(val)
    game.Players.LocalPlayer.Character.Humanoid.JumpPower = val
end)

Section1:CreateSlider("FOV", {Min = 70, Max = 120, Default = 70, Increment = 1}, function(val)
    game.Workspace.CurrentCamera.FieldOfView = val
end)

Section1:CreateButton("Infinite Jump", function()
    -- infinite jump kodu
end)

Section1:CreateButton("NoClip", function()
    -- noclip kodu
end)

